_config.yml</code>\uFF0C\u4E5F\u5C31\u662F\u8BF4\uFF0C\u60F3\u8981\u4FEE\u6539\u914D\u7F6E\u65F6\uFF0C\u53EA\u9700\u8981\u4FEE\u6539 <code>keep.yml</code> \u91CC\u7684\u5373\u53EF\uFF08\u4FEE\u6539 <code>_config.yml</code> \u91CC\u7684\u4E0D\u4F1A\u751F\u6548\uFF09\u3002\u8FD9\u6837\u5C31\u5B9E\u73B0\u4E86\u5E73\u6ED1\u5347\u7EA7\uFF0C\u66F4\u65B0 Keep \u4E3B\u9898\u65F6 <code>_config.yml</code> \uFF08\u53EF\u80FD\uFF09\u4F1A\u66F4\u65B0\uFF0C\u800C\u4F60\u7684\u4E3B\u9898\u914D\u7F6E\u6570\u636E\u4FDD\u7559\u5728 <code>keep.yml</code> \u4E2D\u3002</p><div class="warning custom-block"><p class="custom-block-title">\u6CE8\u610F</p><p>\u4E3B\u9898\u66F4\u65B0\u540E\uFF0C\u5982\u679C\u4E3B\u9898\u76EE\u5F55\u4E0B\u7684 <code>_config.yml</code> \u6587\u4EF6\u91CC\u51FA\u73B0\u4E86\u65B0\u7684\u914D\u7F6E\u9879\uFF0C\u90A3\u4E48\u4F60\u5FC5\u987B\u4ECE\u8BE5\u6587\u4EF6\u4E2D\u5C06\u5B83\u4EEC\u590D\u5236\u5230 <code>/source/_data/keep.yml</code> \u4E2D\uFF0C\u5E76\u8BBE\u7F6E\u5B83\u4EEC\u7684\u503C\u4E3A\u4F60\u60F3\u8981\u7684\u9009\u9879\u3002</p><p>\u5982\u679C\u4F60\u4F7F\u7528\u4E86\u5E73\u6ED1\u5347\u7EA7\u8FD9\u4E00\u7279\u6027\uFF0C\u90A3\u4E48 <code>/themes/keep/_config.yml</code> \u548C <code>/source/_data/keep.yml</code> \u8FD9\u4E24\u4E2A\u6587\u4EF6\u91CC\u7684\u9009\u9879\u6CA1\u6709\u540C\u6B65\uFF0C\u662F\u66F4\u65B0\u4E3B\u9898\u540E\uFF0C\u542F\u52A8\u62A5\u9519\u7684\u6700\u4E3B\u8981\u7684\u539F\u56E0\uFF01</p></div><p>\u6709\u65F6\u5019\uFF0C\u540C\u6B65 <code>/themes/keep/_config.yml</code> \u548C <code>/source/_data/keep.yml</code> \u4E24\u4E2A\u914D\u7F6E\u6587\u4EF6\u91CC\u7684\u5185\u5BB9\u4E5F\u6BD4\u8F83\u9EBB\u70E6\u3002\u56E0\u6B64\uFF0C\u63A8\u8350\u4F7F\u7528\u4EE3\u7801\u5BF9\u6BD4\u5DE5\u5177\u8FDB\u884C\u67E5\u770B\uFF0C\u8FD9\u6837\u518D\u8FDB\u884C\u540C\u6B65\u5C31\u65B9\u4FBF\u591A\u4E86\u3002\u4F8B\u5982 VS Code \u81EA\u5E26\u7684\u4EE3\u7801\u5BF9\u6BD4\u5DE5\u5177\uFF1A <img src="https://cdn.staticaly.com/gh/XPoet/image-hosting